    "2013-03-15T21:05:06.100721",nt"name": "streamnet-query-system-hatchery-returns",nt"isopen":
    false,nt"url": null,nt"notes": "These trends include all counts of fish
    obtained at a hatchery or one of its satellite facilities. The only method allowed
    is hatchery rack / weir, and the count types are either total live fish or total
    live fish returned above hatchery (for fish passed above the barrier). Life stage
    may be adults, jacks, or a combination of the two life stages, and is presumed to
    be adults, unless specified otherwise in the source documentation. The principal
    sources of these data are published agency reports, and unpublished agency files
    and data bases. This data category is available through StreamNet's online query
    system, which allows users to explore and filter the StreamNet database and download
    selected results. For help in using the StreamNet query system, please consult the
    user guide, available at http://www.streamnet.org/onlinehelp/user_guide_03.html",nt"license_title":
